import React from 'react';
import { Navbar } from '../components/Navbar';
import { Footer } from '../components/Footer';

type PageProps = {
  currentLanguage: string;
  onLanguageChange: (language: string) => void;
};

export const Page: React.FC<PageProps> = ({ currentLanguage, onLanguageChange, children }) => {
  return (
    <div className="min-h-screen font-montserrat flex flex-col">
      <Navbar currentLanguage={currentLanguage} onLanguageChange={onLanguageChange} />
      {children}
      <Footer />
    </div>
  );
};
